import React, { Component } from 'react'
import Overlay from 'react-image-overlay'

export default class TestingOverlay extends Component {
  render() {
    return (
      <Overlay
        url='https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcRnuY63p6ZxSaNVe48lKp-PMDbByCl3pG3YQv70Q6nu6XgItEDdw1YcnhrNgMVsaTl-nl6aFO9ta9xn5GhGnjMPbA' // required
        overlayUrl='https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Mr._Smiley_Face.svg/1024px-Mr._Smiley_Face.svg.png' // required
        imageHeight={100}
        position={'bottomRight'}
        overlayWidth={50}
        overlayHeight={50}
        overlayPadding={10}
        watermark={false}
      />
    )
  }
}
